      SELECT - 58 + - - col2 FROM tab1 (FORMAT parquet) WHERE NOT - col1 + + col1 IN ( col0 + - - col2 + - 22 - - col2 );
  - name: tab1

outputs:
  - name: q5661.out
    data: |
      1
      10
      38
